import React from "react";
import "./style/sidenav.scss";
import { TrackerIcon } from "../icons/icons";

interface INavArray {
  id: number;
  name: string;
  icon: JSX.Element;
  route?: string;
}

const Sidenav: React.FC = () => {
  return (
    <div className="sidenav-container">
      <div className="main-icon">
        <TrackerIcon />
      </div>
      <div className="main-tabs_container pt--50">
        {NAVARRAY.map((item: INavArray) => {
          return <div className="main-icon active-background">{item.icon}</div>;
        })}
      </div>
    </div>
  );
};

export default Sidenav;

const NAVARRAY: INavArray[] = [
  {
    id: 1,
    name: "dashboard",
    icon: <TrackerIcon />,
    route: "/dashboard",
  },
